function deleteChekedProducts(){var n=$(".checkbox:checked"),i=n.length,t;i>0&&(t=n.map(function(){return parseInt($(this).val())}).get(),deleteProducts(t))}function deleteProducts(n){if(confirm("Вы действительно хотите удалить вакансии?")){var t={vacanciesId:n},i=JSON.stringify(t);$.ajax({url:"/cabinet/vacancies/delete",type:"POST",contentType:"application/json; charset=utf-8",data:i,success:function(n){$("table.added").html(n)},error:function(){}})}}